import React from "react";
import "./styles/Button.css";

function Button({ variant, color, children, action }) {
  return (
    <button
      style={{ backgroundColor: "lightblue" }}
      className={variant}
      onClick={action}
    >
      {children}
    </button>
  );
}

export default Button;
